/********************************************************************
* FUNCTION u_o_ran_beamforming_beamforming_information_update_send
*
* Send a u_o_ran_beamforming_beamforming_information_update notification
* Called by your code when notification event occurs
*
********************************************************************/
void u_o_ran_beamforming_beamforming_information_update_send (
    const xmlChar *v_band_number)
{
    val_value_t *parmval = NULL;
    status_t res = NO_ERR;

    if (!agt_notifications_enabled()) {
        log_debug2("\nSkipping <beamforming-information-update> notification; disabled");
        return;
    }
    
    if (LOGDEBUG) {
        log_debug("\nGenerating <beamforming-information-update> notification");
    }
    
    agt_not_msg_t *notif = agt_not_new_notification(beamforming_information_update_obj);
    if (notif == NULL) {
        log_error("\nError: malloc failed, cannot send "
        "<beamforming-information-update> notification");
        return;
    }
    
    /* add band_number to payload */
    parmval = agt_make_leaf2(
        beamforming_information_update_obj,
        y_o_ran_beamforming_M_o_ran_beamforming,
        y_o_ran_beamforming_N_band_number,
        v_band_number,
        &res);
    if (parmval == NULL) {
        log_error(
            "\nError: make leaf failed (%s), cannot send "
            "<beamforming-information-update> notification",
            get_error_string(res));
    } else {
        agt_not_add_to_payload(notif, parmval);
    }
    
    sil_sa_queue_notification(notif);
    
} /* u_o_ran_beamforming_beamforming_information_update_send */

